    enum EventStatus {
        PENDING,
        COMPLETED
    }

    struct Event {
        string eventName;
        uint256 requiredFund;
        address fundRaiserAddress;
        EventStatus status;
        uint256 collectedFund;
        string description;
    }

    struct projectsDonated {
        string eventName;
        uint256 donatedAmount;
    }

    error invalidFund();
    error unAuthorized();
    error transactionUnsuccessful();

    Event[] public events;

    mapping(address => projectsDonated[]) donors;

